import React from "react";
import impressionIcon from "../images/impressionIcon.png";

function TrendingQuizBox({ quizName, impressions, createdAt }) {
  return (
    <div
      style={{
        height: "10vh",
        width: "14vw",
        backgroundColor: "white",
        marginLeft: "3vw",
        marginTop: "3vh",
        borderRadius: "5px",
        fontWeight: "600",
        paddingRight: "0.8vw",
        paddingBottom: "0.5vh",
      }}
    >
     
        <img
          style={{ marginLeft: "0.3vw", height: "2.5vh", width: "1.3vw" }}
          src={impressionIcon}
          alt="impressionIcon"
        />
    
      <p
        style={{
          color: "#60B84B",
          fontSize: "1em",
          marginTop: "1.5vh",
          paddingLeft:"1vw",
        }}
      >
        Created on : {createdAt}
      </p>
    </div>
  );
}

export default TrendingQuizBox;
